/**
 * Type-safe profile ID union type
 */
export type ProfileId = typeof PRESET_PROFILES[number]['profileId'];

/**
 * Get a profile by ID (type-safe)
 */
export function getProfileById(id: ProfileId): Profile;
export function getProfileById(id: string): Profile | undefined;
export function getProfileById(id: string): Profile | undefined {
  return PRESET_PROFILES.find((p) => p.profileId === id);
}

/**
 * Get all available profile IDs
 */
export function getProfileIds(): ProfileId[] {
  return PRESET_PROFILES.map((p) => p.profileId) as ProfileId[];
}

/**
 * Get the default profile (Paul)
 */
export function getDefaultProfile(): Profile {
  return PRESET_PROFILES[0];
}
